export const useStyles = makeStyles({
  container:{
    width:790,
    margin:"0 auto",
    marginTop:117
  },
  getStarted:{
    width:480,
    margin:"0 auto"
  },
  text:{
    '& p':{
      letterSpacing:2.25,
      textAling:'center',
      fontSize:64,
      fontWeight:'bold',
    }

  }
})
